import React from 'react'
import {View, Text} from 'react-native'
export default function Agenda() {
  return (
    <View>
        <Text> Agenda</Text>
        <script>
        function openTab() {
          window.open("https://www.educative.io/", "_blank")} 
    </script>

    </View>
  )
}
